import React, { useEffect, useState } from "react";
import axios from "axios";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import ProfilePage from "./pages/ProfilePage";
import OrganizationPage from "./pages/OrganizationPage";
import "./App.css";

function App() {
  const [users, setUsers] = useState([]);
  const [matches, setMatches] = useState([]);
  const [tournaments, setTournaments] = useState([]);

  // Mock current user
  const currentUser = {
    id: 1,
    username: "Alice",
    points: 3000,
    organization: "Org X",
    organization_id: 1,
    friends: ["Bob", "Charlie"]
  };

  // Fetch data from backend
  useEffect(() => {
    const fetchData = async () => {
      try {
        const [usersRes, matchesRes, tournamentsRes] = await Promise.all([
          axios.get("http://localhost:5000/api/users"),
          axios.get("http://localhost:5000/api/matches"),
          axios.get("http://localhost:5000/api/tournaments")
        ]);
        setUsers(usersRes.data);
        setMatches(matchesRes.data);
        setTournaments(tournamentsRes.data);
      } catch (err) {
        console.error(err);
      }
    };
    fetchData();
  }, []);

  // Helper to render tables dynamically with numbered rows
  const renderTable = (title, data, columns) => (
    <div className="table-section">
      <h2>{title}</h2>
      <table className="custom-table">
        <thead>
          <tr>
            {columns.map((col) => (
              <th key={col}>{col}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              {columns.map((col) =>
                col === "No" ? (
                  <td key={col}>{index + 1}</td>
                ) : (
                  <td key={col}>{row[col.toLowerCase()] ?? "N/A"}</td>
                )
              )}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );

  // Filter data for specific tables
  const globalLeaderboard = users;
  const organizationLeaderboard = users.filter(u => u.organization === currentUser.organization);
  const friendsLeaderboard = users.filter(u => currentUser.friends.includes(u.username));
  const lastFiveMatches = matches
    .filter(m => m.user_id === currentUser.id)
    .slice(0, 5);
  const orgTournaments = tournaments
    .filter(t => t.organization_id === currentUser.organization_id)
    .slice(0, 5);

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <div className="page-container">
              {/* User Bar */}
              <div className="user-bar">
                <span>User: {currentUser.username}</span>
                <span>Points: {currentUser.points}</span>
                <span>Organization: {currentUser.organization}</span>
                <Link to="/profile">
                  <button className="small-button">Profile</button>
                </Link>
                <Link to="/organization">
                  <button className="small-button">Organization</button>
                </Link>
              </div>

              <div className="dashboard-row">
                {/* Left side: Leaderboards */}
                <div className="tables-wrapper">
                  {renderTable("Global Leaderboard", globalLeaderboard, ["No", "Username", "Points", "Organization"])}
                  {renderTable("Organization Leaderboard", organizationLeaderboard, ["No", "Username", "Points", "Organization"])}
                  {renderTable("Friends Leaderboard", friendsLeaderboard, ["No", "Username", "Points", "Organization"])}
                </div>

                {/* Right side: Matches and Org Tournaments */}
                <div className="matches-wrapper">
                  {renderTable("Last 5 Matches", lastFiveMatches, ["No", "Points", "Score", "Match_date"])}
                  {renderTable("Organization Tournaments", orgTournaments, ["No", "Time", "Date", "Max_players"])}
                </div>
              </div>
            </div>
          }
        />
        <Route path="/profile" element={<ProfilePage />} />
        <Route path="/organization" element={<OrganizationPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
      </Routes>
    </Router>
  );
}

export default App;
